INSERT INTO `ticket` (`ticket_id`, `proj_id`, `name`, `slug`, `description`, `start_date`, `end_date`, `column_id`, `estimated_hours`, `actual_hours`, `rework_hours`, `status`, `created_by`, `entry_time`, `update_time`, `ip_address`) VALUES
(50, 1, 'Homepage- Quote attribution  / organization length adjustment', 'T2', 'Currently, within a testimonial, the \"Organization\" input is limited to 200 characters. Can we open that up to unlimited? ', '2018-11-26 00:00:00', '2018-12-08 23:59:59', 3, NULL, NULL, NULL, '1', 1, '2019-02-22 18:06:39', '2019-03-18 23:50:19', '114.143.234.170'),
(54, 2, 'CMS', 'T6', 'The Statistics component is not displaying on any page. If I\'m in any page, click on a box, and select \"Statistics\", save, and publish, it should display on the front end. Nothing is displaying.', '2018-11-26 00:00:00', '2018-12-27 23:59:59', 3, NULL, NULL, NULL, '1', 1, '2019-02-22 18:09:08', '2019-02-26 18:22:42', '114.143.234.170'),
(55, 2, 'Global CMS', 'T7', 'How does the testimonial component on the WYSIWYG page work? Currently I click the button and nothing happens? should a pop up display with a dropdown menu? How do I choose the testimonial to display? does the user have to put the testimonial into the Testimonial widget before selecting it in the dropdown?', '2019-02-27 00:00:00', '2018-12-27 23:59:59', 3, NULL, NULL, NULL, '1', 1, '2019-02-22 18:09:31', '2019-02-26 18:21:42', '114.143.234.170'),
(56, 2, 'Add copywrite symbol', 'T8', 'Add copywriter symbol in footer', '2019-02-26 00:00:00', '2018-12-28 23:59:59', 3, NULL, NULL, NULL, '1', 1, '2019-02-22 18:09:50', '2019-02-26 18:24:52', '114.143.234.170'),
(57, 1, 'CLC - Mobile Quote Section Adjustment. ', 'T9', 'On mobile,  when a user moves from Gail Bordeaux\'s quote to John Roger\'s quote via the arrow button, you go from the quote to the \"Want to Learn More?\" section of the page, rather than his quote or title.\n\nThis appears to happen as the page is dynamically adjusting height to accommodate the length of the quote. This is working as expected, however, is there any way we can fix the height of that section to the longest quote so the user doesn\'t think they are being pushed to a new section? ', '2018-11-27 00:00:00', '2018-12-08 23:59:59', 3, NULL, NULL, NULL, '1', 28, '2019-02-22 19:32:27', '2019-03-18 23:50:30', '114.143.234.170'),
(58, 20, 'Logo', 'T10', 'Let\'s revove any logo size changing. So keep it in line with the main nav as seen here: https://zpl.io/VKKR9vq', '2019-02-26 00:00:00', '2019-03-04 23:59:59', 3, NULL, NULL, NULL, '1', 1, '2019-02-22 20:48:23', '2019-03-12 17:38:19', '114.143.234.170'),
(59, 1, 'Mobile footer', 'T11', 'Just curious- is there anything you can do for the footer on samsung? Can you make it so the logos are stacked on top of each other? Or is this just how it will look on samsung devices?', '2018-11-26 00:00:00', '2018-12-12 23:59:59', 3, NULL, NULL, NULL, '1', 1, '2019-02-26 17:55:04', '2019-02-26 18:22:50', '114.143.234.170'),
(60, 1, 'Captcha', 'T12', 'Can you please supply me with credentials for the captcha on all the Contact Us pages?', '2018-11-26 00:00:00', '2018-12-12 23:59:59', 3, NULL, NULL, NULL, '1', 1, '2019-02-26 17:58:15', '2019-02-26 18:22:56', '114.143.234.170'),
(61, 1, 'CMS Changes', 'T13', '1) Please add a \"Select Page\" for the testimonials. \n\n2) Please add the Testimonial, Schedules Grid, and Statistics components on the WYSIWYG page (All components on the CEOP and LWE site should be available on the CLC site even if there isn\'t any content for it).', '2018-11-27 00:00:00', '2018-12-08 23:59:59', 3, NULL, NULL, NULL, '1', 1, '2019-02-26 18:03:14', '2019-02-26 18:04:17', '114.143.234.170'),
(62, 1, 'Mobile Contact Us Button', 'T14', '\"Contact Us\" text in button is not centered', '2018-11-28 00:00:00', '2018-12-11 23:59:59', 3, NULL, NULL, NULL, '1', 1, '2019-02-26 18:04:48', '2019-02-26 18:05:29', '114.143.234.170'),
(63, 1, 'Global link styling', 'T15', 'Please ensure the global link styling (across the entire site, and for any newly created links in the CMS) is correct. Please refer to the Zeplin designs (Contact Us page has an example zpl.io/blP6wq1) It should be blue and underlined.', '2018-11-28 00:00:00', '2019-03-16 23:59:59', 2, 2, 2, 0, '1', 1, '2019-02-26 18:05:39', '2019-04-03 19:00:04', '114.143.234.170'),
(64, 1, 'Global - CMS Adjustments ', 'T16', 'See attached feedback on the CMS setup. There are some revisions we would like to see to make the CMS more intuitive for the client. Let me know if you have any questions. ', '2018-11-28 00:00:00', '2018-12-11 23:59:59', 3, NULL, NULL, NULL, '1', 1, '2019-02-26 18:06:24', '2019-02-26 18:22:53', '114.143.234.170'),
(65, 1, 'CLC UAT Feedback', 'T17', 'CLC UAT Feedback', '2018-11-28 00:00:00', '2018-12-11 23:59:59', 3, NULL, NULL, NULL, '1', 1, '2019-02-26 18:08:59', '2019-02-26 18:22:58', '114.143.234.170'),
(67, 2, 'Footer Alignment', 'T19', 'Footer Alignment issue on microsoft edge.', '2018-11-26 00:00:00', '2018-12-18 23:59:59', 3, NULL, NULL, NULL, '1', 1, '2019-02-26 18:19:11', '2019-02-26 18:25:03', '114.143.234.170'),
(68, 2, 'Global - CEOP/LWE Participant Portal Edit', 'T20', 'Once password is changed remove below text area.', '2018-11-26 00:00:00', '2018-12-27 23:59:59', 3, NULL, NULL, NULL, '1', 1, '2019-02-26 18:23:13', '2019-02-26 18:23:28', '114.143.234.170'),
(69, 2, 'Mobile hero images', 'T21', 'On mobile devices the hero images are displaying the far right of the photo instead of centering. Is there a way to fix it? If not thats okay. see screeshots', '2018-11-26 00:00:00', '2018-12-27 23:59:59', 3, NULL, NULL, NULL, '1', 1, '2019-02-26 18:23:43', '2019-02-26 18:23:57', '114.143.234.170'),
(70, 2, 'Reset Password- Global Change', 'T22', '1. Add a space between Settings and the - so it looks like: Settings - Reset Your Password\" \n2.Change security text to read: \"Your new password must be at least eight characters long, and include at least one number, uppercase letter, and special character.\"', '2018-11-26 00:00:00', '2018-12-04 23:59:59', 3, NULL, NULL, NULL, '1', 1, '2019-02-26 18:24:10', '2019-02-26 18:24:36', '114.143.234.170'),
(71, 2, 'LWE Participant Portal Profile Dropdown Selector ', 'T23', 'Within the participant profile,  for the Ethnicity box, the dropdown menu will not appear if you click on the down caret, only if you click on the word “Ethnicity”.  Please edit so that clicking on the caret also activates the drop-down menu. ', '2018-11-26 00:00:00', '2018-12-12 23:59:59', 3, NULL, NULL, NULL, '1', 1, '2019-02-26 18:26:33', '2019-02-26 18:26:50', '114.143.234.170'),
(72, 2, 'LWE Participant Portal Profile bug', 'T24', ' In participant and advocate business/mobile phone number fields, a red message about “enter valid phone number” appears under the field if dashes are used.  In the assistant phone number fields, the same message does not appear. Please make sure the same error message appears in the assistant phone number field as well.', '2018-11-26 00:00:00', '2018-12-12 23:59:59', 3, NULL, NULL, NULL, '1', 1, '2019-02-26 18:27:02', '2019-02-26 18:27:24', '114.143.234.170'),
(73, 2, 'Ambassadors Page Video Update', 'T25', 'Move “The Power of the LWE Network” video to this page – can be found on the “Leading With Purpose Symposium” event page on the old LWE website ', '2018-11-26 00:00:00', '2018-12-12 23:59:59', 3, NULL, NULL, NULL, '1', 1, '2019-02-26 18:27:42', '2019-02-26 18:27:57', '114.143.234.170'),
(74, 2, 'Homepage Quotes Reordering', 'T26', ' Reorder quotes on the Homepage in the following order: Scanlon, Howze, Yazdi  ', '2018-11-26 00:00:00', '2018-12-12 23:59:59', 3, NULL, NULL, NULL, '1', 1, '2019-02-26 18:28:10', '2019-02-26 18:28:23', '114.143.234.170'),
(75, 20, 'Scroll functionality', 'T27', 'This is missing specified scroll functionality. As noted in wireframes and Zeplin, it should have a disappear on scroll down, reappear on scroll up functionality. ', '2019-02-26 00:00:00', '2019-03-11 23:59:59', 3, NULL, NULL, NULL, '1', 1, '2019-02-26 18:39:39', '2019-02-26 21:47:13', '114.143.234.170'),
(76, 20, 'Skip to main content', 'T28', 'Element is missing. From wireframes: When user hits the tab button upon arriving to the page, an option will appear to “Skip to main content”, which if selected will skip user tabbing through navigation options.', '2019-02-26 00:00:00', '2019-03-11 23:59:59', 3, NULL, NULL, NULL, '1', 1, '2019-02-26 18:47:13', '2019-02-26 18:47:50', '114.143.234.170'),
(77, 20, 'Spacing', 'T29', 'Left column should have 29px of space between side of screen.', '2019-02-26 00:00:00', '2019-03-11 23:59:59', 3, NULL, NULL, NULL, '1', 1, '2019-02-26 18:47:59', '2019-02-26 18:48:42', '114.143.234.170'),
(78, 20, 'Main navigation', 'T30', 'Main navigation should look like Zeplin. Please fix. \nClosed: https://zpl.io/aRWON60\nMenu open: https://zpl.io/aByMOrA\nSearch open: https://zpl.io/bLKMjgB', '2019-02-26 00:00:00', '2019-03-11 23:59:59', 3, NULL, NULL, NULL, '1', 1, '2019-02-26 18:48:53', '2019-02-26 18:49:19', '114.143.234.170'),
(79, 20, 'Footer Links', 'T31', 'The headers in the footer (About ASME, Codes & Standards, etc) should have the blue hover state. ', '2019-02-26 00:00:00', '2019-03-11 23:59:59', 3, NULL, NULL, NULL, '1', 1, '2019-02-26 18:49:46', '2019-02-26 18:50:03', '114.143.234.170'),
(80, 20, 'Tags', 'T32', 'The tag \"pills\" at the bottom should be links with a hover effect like seen on the homepage.', '2019-02-26 00:00:00', '2019-03-11 23:59:59', 3, NULL, NULL, NULL, '1', 1, '2019-02-26 18:50:34', '2019-02-26 18:50:54', '114.143.234.170'),
(81, 20, 'Related Content Links', 'T33', 'The underline on these links looks way thicker than other links on the site.', '2019-02-26 00:00:00', '2019-03-11 23:59:59', 3, NULL, NULL, NULL, '1', 1, '2019-02-26 18:51:59', '2019-02-26 18:52:15', '114.143.234.170'),
